import React from "react";
import Formikform from "../../Helpers/Form";
// import * as valid_err from "../../../Utils/Common_Messages";
import { useFormik } from "formik";

const Auth = () => {


  const formik = useFormik({
    initialValues: {
      panel_name: "",
      domain: "",
      port: "",
      key: "",
      ip_address: "",
      is_active: 1,
      is_expired: 0,
      theme_id: "",
      db_url: "",
      db_name: "",
      broker_id: [],
      Create_Strategy: false,
      Option_chain: false,
      Strategy_plan: false,
      backend_rul: "",
    },

    validate: (values) => {
      const errors = {};

      // if (!values.panel_name && formik.touched.panel_name) {
      //   errors.panel_name = valid_err.PANEL_NAME_ERROR;
      // }

      // if (!values.domain) {
      //   errors.domain = valid_err.DOMAIN_ERROR;
      // }

      // if (!values.port) {
      //   errors.port = valid_err.PORT_ERROR;
      // }

      // if (!values.key) {
      //   errors.key = valid_err.KEY_ERROR;
      // }

      // if (!values.db_url) {
      //   errors.db_url = valid_err.DBURL_ERROR;
      // }

      // if (!values.db_name) {
      //   errors.db_name = valid_err.DBNAME_ERROR;
      // }

      // if (!values.backend_rul) {
      //   errors.backend_rul = valid_err.DBNAME_ERROR;
      // }

      return errors;
    },
    onSubmit: async (values) => {
      const req = {
        // panel_name: values.panel_name,
        // domain: values.domain,
        // port: values.port,
        // key: values.key,
        // ip_address: values.ip_address,
        // theme_id: values.theme_id,
        // db_url: values.db_url,
        // db_name: values.db_name,
        // broker_id: state1,
        // Create_Strategy:
        //   values.Create_Strategy && values.Create_Strategy ? 1 : 0,
        // Option_chain: values.Option_chain && values.Option_chain ? 1 : 0,
        // Strategy_plan: values.Strategy_plan && values.Strategy_plan ? 1 : 0,
        // backend_rul: values.backend_rul,
      };

      // await dispatch(Add_Panel_data({ req: req, token: user_token }))
      //   .unwrap()
      //   .then((response) => {
      //     if (response.status === 409) {
      //       toast.error(response.data.msg);
      //     } else if (response.status) {
      //       toast.success(response.msg);

      //       setTimeout(() => {
      //         navigate("/super/alladmins");
      //       }, 1000);
      //     } else if (!response.status) {
      //       toast.error(response.msg);
      //     }
      //   });
    },
  });

  const fields = [
    {
      name: "panel_name",
      label: "Panel Name",
      type: "text",
      label_size: 12,
      col_size: 6,
    },
    {
      name: "domain",
      label: "Domain",
      type: "text",
      label_size: 12,
      col_size: 6,
    },
    {
      name: "port",
      label: "Port",
      type: "text",
      label_size: 12,
      col_size: 6,
    },
    {
      name: "key",
      label: "key",
      type: "text",
      label_size: 12,
      col_size: 6,
    },
    {
      name: "ip_address",
      label: "Ip Address",
      type: "text",
      label_size: 12,
      col_size: 6,
    },
    {
      name: "db_url",
      label: "Database Url",
      type: "text",
      label_size: 12,
      col_size: 6,
    },

    {
      name: "db_name",
      label: "Database Name",
      type: "text",
      label_size: 12,
      col_size: 6,
    },

    {
      name: "backend_rul",
      label: "Backend Url",
      type: "text",
      label_size: 12,
      col_size: 12,
    },
    {
      name: "Create_Strategy",
      label: "Create Strategy",
      type: "checkbox",
      label_size: 12,
      col_size: 3,
      check_box_true: formik.values.Create_Strategy ? true : false,
    },
    {
      name: "Option_chain",
      label: "Option Chain",
      type: "checkbox",
      label_size: 12,
      col_size: 3,
      check_box_true: formik.values.Option_chain ? true : false,
    },
    {
      name: "Strategy_plan",
      label: "Strategy Plan",
      type: "checkbox",
      label_size: 12,
      col_size: 3,
      check_box_true: formik.values.Strategy_plan ? true : false,
    },
  ];

  return (
    <>
      <div className="container " >
        <div className="row d-flex align-items-center justify-content-center" style={{height :'100vh'}}>
          <div className="hero">
            <div className="cube" />
            <div className="cube" />
            <div className="cube" />
            <div className="cube" />
            <div className="cube" />
            <div className="cube" />
          </div>
          <div className="col-sm-10 col-md-8 col-lg-5">
            <div className="middle-box py-4">
              <div className="card">
                <div className="card-body p-4">
                  {/* Logo */}
                  <h4 className="font-24 mb-30">Login.</h4>
                  <form action="#">
                    <div className="form-group mb-3">
                      <input
                        className="form-control login"
                        type="email"
                        id="emailaddress"
                        required=""
                        placeholder="Enter your email"
                        style={{
                          backgroundImage: 'url("data:image/png',
                          backgroundRepeat: "no-repeat",
                          backgroundSize: 20,
                          backgroundPosition: "97% center",
                          cursor: "auto",
                        }}
                        data-temp-mail-org={0}
                      />
                    </div>
                    <div className="form-group mb-3">
                      <a
                        href="forget-password.html"
                        className="text-dark float-right"
                      />
                      <input
                        className="form-control login"
                        type="password"
                        required=""
                        id="password"
                        placeholder="Enter your password"
                      />
                    </div>
                    <div className="form-group d-flex justify-content-between align-items-center mb-3">
                      <div className="checkbox d-inline mb-0">
                        <input
                          type="checkbox"
                          name="checkbox-1"
                          id="checkbox-8"
                        />
                        <label htmlFor="checkbox-8" className="cr mb-0 font-13">
                          Remember me
                        </label>
                      </div>
                      <span>
                        <a
                          className="font-12 text-success"
                          href="forget-password.html"
                        >
                          Forgot your password?
                        </a>
                      </span>
                    </div>
                    <div className="form-group mb-0">
                      <button
                        className="btn btn-primary btn-block"
                        type="submit"
                      >
                        Log In
                      </button>
                    </div>
                    <div className="text-center mt-15">
                      <span className="mr-2 font-12">
                        Don't have an account?
                      </span>
                      <a className="font-12" href="register.html">
                        Sign up
                      </a>
                    </div>
                  </form>
                  {/* end card */}
                </div>
              </div>
            </div>
          </div>
        </div>
      </div>
    </>
  );
};

export default Auth;
